import './App.css';
import React, { useState } from 'react';

function App() {

  const getData = async () => {
    const response = await fetch('https://www.koreaexim.go.kr/site/program/financial/exchangeJSON?authkey=3wNf5tfXGjytedr8fF3AUEljbd30YBED&data=AP01');
    const body = await response.json();
    console.log(body);
  }

  return (
    <button onClick={getData}>데이터 불러오기</button>
  );
}

export default App;
